  let btnShow = ref(false) //\u6309\u94AE\u5F00\u5173
  let time = null //\u8BA1\u65F6
  let show = ref(false) //\u6587\u5B57\u9690\u85CF \u663E\u793A
  let itemId = ref(0) // \u5F53\u524D\u5185\u5BB9\u7D22\u5F15
  let title = ref(lists[nowIndex.value].list[itemId.value].text) //\u5185\u5BB9
  let date = ref(lists[nowIndex.value].list[itemId.value]?.date) //\u65E5\u671F

  let timer = 0
  
  function start(){
      play()
      btnShow.value = true
      time = setInterval(() => {
      // \u83B7\u53D6list\u4E2D\u5F53\u524D\u7D22\u5F15\u7684\u65F6\u95F4
      const item = lists[nowIndex.value].list[itemId.value]
      if(timer<item.end){
        show.value = true
        title.value = item.text
        date.value = item?.date
        timer++
      }else{
        show.value = false
        // \u662F\u5426list\u6700\u540E\u4E00\u6761
        if(itemId.value === lists[nowIndex.value].list.length - 1){
          itemId.value = 0
          timer = 0
          stop()
          // \u662F\u5426lists\u6700\u540E\u4E00\u5217
          nowIndex.value = nowIndex.value === lists.length - 1?0: nowIndex.value+1
          setTimeout(() => {
            play()
          }, 1000);
        }else{
          itemId.value++
        }
      }
      console.log(timer);
    }, 1000);
  }

  

  function play(){
    if(!isPlaying){
      audio.value.play();
      isPlaying = true;
    }
  }

  function stop(){
    if(isPlaying){
      isPlaying = false;
      audio.value.pause();
      audio.value.currentTime = 0;
    }
  }
  // \u9875\u9762\u9500\u6BC1 \u5173\u95ED\u5B9A\u65F6\u5668
  onBeforeUnmount(() => {
    window.clearInterval(time)
  });
